import React from "react";
import { Link } from "react-router-dom";
import ReactPlayer from "react-player";

import quizOneBackground from "../visuals/quiz/q1_background.mp4";
export default function questionOne() {
  return (
    <div className="questionContainer">
      <ReactPlayer
        className="react-player quiz-video"
        url={quizOneBackground}
        width="100%"
        height="100%"
        controls={false}
        loop={true}
        playing={true}
      />
      <div className="content">
        <h1>What is your goal with today's treatment?</h1>
        <div className="door-container ">
          <div className="door doorOne">
          <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 131.48 217.28"><g id="Layer_2" data-name="Layer 2"><g id="Layer_2-2" data-name="Layer 2"><path class="cls-1" d="M65.78.5C29.77.5.58,24.12.58,53.26c0,.89,0,1.78.08,2.67H.5V216.78H130.88V56.12c.07-.94.1-1.9.1-2.86C131,24.12,101.79.5,65.78.5Z" fill='none' stroke='black'/></g></g></svg>
          </div>
          <div className="door doorTwo">door two</div>
          <div className="door doorThree">door 3</div>
        </div>
        <Link to="/question-two">Room two </Link>
      </div>
    </div>
  );
}
